/*Table structure for table `votantes` */

DROP TABLE IF EXISTS `votantes`;

CREATE TABLE `votantes` (
  `ideleccion` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `idvotante` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  `idcurso` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`ideleccion`,`idvotante`,`idcurso`),
  KEY `FK_votantes_estudiantes` (`idvotante`),
  KEY `FK_votantes_cursos` (`idcurso`),
